import React,{ Component } from "react";
import { Table } from "reactstrap";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

class NurseList extends Component{
    constructor(props){
        super(props)
        this.state={
            Nurses: ''
        }
    }
    async componentDidMount(){
        const url="http://localhost:3001/Nurse"
        const response = await fetch(url)
        const data = await response.json()
        this.setState({Nurses : data});
    }
    showList(){
        let rows=[]
        // console.log(this.state.Nurses)
        let nurseData = this.state.Nurses;
        console.log(nurseData[0])
        for( let i = 0; i< Object.keys(nurseData).length; i++){
            rows.push(
                <tr key={nurseData[i][6]}>
                    <td>{nurseData[i][6]}</td>
                    <td>{nurseData[i][5]}</td>
                    <td>{nurseData[i][2]}</td>
                    <td>{nurseData[i][0]}</td>
                    <td>{nurseData[i][5]}</td>
                    <td>{nurseData[i][1]}</td>
                    <td>{nurseData[i][3]}</td>
                </tr>
            )
        }
        return rows
    }
    render(){
        return(
            <div>
                <Table className="highlight">
                    <ToastContainer position="top-right"
                    autoClose={5000}
                    hideProgressBar={false}
                    newestOnTop={false}
                    closeOnClick
                    rtl={false}
                    pauseOnFocusLoss
                    draggable
                    pauseOnHover/>
                    <thead>
                        <tr>
                            <th data-field="NID">NurseID</th>
                            <th data-field="name">Name</th>
                            <th data-field="gender">Gender</th>
                            <th data-field="location">Location</th>
                            <th data-field="phone">Phone</th>
                            <th data-field="Email">Email</th>
                            <th data-field="date">Join Date</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.data.map((numList,i) =>(
                        <tr key={i}>
                            {
                            numList.map((num,j)=>
                                <td key={j}>{num}</td>
                            )
                            }
                        </tr>
                                ))
                        }
                    </tbody>
                </Table>
            </div>
        )
    }
}

export default NurseList;
